import '../style1.css';
import '../style.css';
import React , {Component } from 'react';
import Cities from '../cities.json'

class Table extends Component  {
constructor(){
    super()
    this.state={
        Cities: Cities
        
    }
}
    delete(d){
        const Cities = this.state.Cities.filter(a => a.id !== d.id)
        this.setProps({Cities})
      }

 //الكتابه 
render() { 
const {datajson } = this.props ;


    return(
        <div>
            <table id="table" >
            <tbody>    
                <tr>
            <td  >المدن</td>
            <td >عدد السكان</td>
                </tr>
        {datajson.map(function data(d) {
        
        
            return(
        
                <tr key={d.id} >
                    <td >{d.citie}</td>
                    <td >{d.peples}</td>
                    <td>
                    <button > تعديل </button> 
                    <button  id = "delet" onClick={this.delete.bind(this,d)} > حدف  </button> 
                    </td>
                </tr>
                    )   
                })}
            </tbody>
            </table>
        
    
        </div>
        )

}
}
export default Table;
